import React, {Component} from 'react'
import data from "./sectionInfo.json"

class DisplayTable extends Component {

    render() {
        return (
            <Container>
              <Grid>
                <Grid.Row>
                  <Grid.Column>
                    <Header>List</Header>
                    <List>
                      {contacts.map(el => {
                        return (
                          <List.Item  key={el.id}>
                            <List.Content>
                              {el.firstname} {el.lastname}
                            </List.Content>
                            <List.Content>{el.phone}</List.Content>
                          </List.Item>
                        );
                      })}
                    </List>
                  </Grid.Column>
                </Grid.Row>
              </Grid>
            </Container>
          );
    }
        

    
}
    
export default DisplayTable
